import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './home.css';
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route} from "react-router-dom";
import axios from 'axios';

import Navbar from "./navbar.component.js";
import businessCards from "./businessCards.component";
import business from "./business.component";
import settings from "./settings.component.js";

export default class home extends Component {
    constructor(props) {
      super(props);

	  this.state = {
	  	  businesses: []
	  }
	}
	
	componentDidMount() {
		this.fetchBusiness();
	}

	fetchBusiness() {
		axios.get("http://localhost:8080/fetchBusiness", {
		}).then(response => {
			console.log("User businesses: ")
			console.log(response)
			this.setState({
				businesses: response.data
			})
				console.log(this.state.businesses)
		}).catch(error => {
			console.log(error)
		})
	}



	

	render () {

		  const listBusinesses = this.state.businesses.map(business => {
            return <Navbar />
			})

		return (
			<Router> 
			
			<div className = "section">
			<Navbar />
			
	
			<br />
			<switch>
			<Route path="/user" exact component={businessCards} />
			 <Route path="/settings" component={settings} />
			  <Route path="/user/business1" exact component={business} />
			  </switch>

			   <div className = "section">
                <Navbar />
                { this.state.businesses }
                { listBusinesses }            </div>

			</div>
			</Router> 
		);
	}
}
